import React from "react";
import "./JokeStyle.css"

function Joke(props) {
  return (
    <div>

      <p className="jokeQStyle" style={{display: props.content.question ? "block" : "none"}}>{"Question: " + props.content.question}</p>
      <p className="jokePStyle">{"Punchline: " + props.content.punchline}</p>
    </div>
  );
}

export default Joke;
